import React, { useState,useEffect } from 'react';
//import icon 
import icon from './icon-offices.svg'

const data=[
    {
        icon:icon,
        title:"Singapore",
        address:"155B Telok Ayer Street", 
        city:"Singapore, 068611"
    },
    {
        icon:icon,
        title:'Washington DC',
        address:'1701 Rhode Island Ave NW',
        city:'Washington, DC 20036'
    }
]

function OfficesCard(iconURL,title,content){
    return(

    <div className="row">
            <div className="col-md-4 mb-8">
                <div className="d-flex flex-column bg-white rounded sw-rounded p-5 text-center position-relative">
                <figure className="mb-4 d-none">
                    <img 
                    srcset={`${iconURL} 320w, ${iconURL} 480w, ${iconURL} 600w`}
                    src={`${iconURL}`}
                    alt="office address" width="136" className=""/>
                </figure>
                <h3 className="sw-heading-alt sw-heading-alt-2 mb-2">Go beyond lead scoring</h3>
                <p className="mb-md-0">Saleswhale helps to engage leads that are not immediately actioned by the sales team - engaging them in two-way conversation to sniff out if they are ready to buy.</p>

                </div>

            </div>
        </div>

    )

}


export default function Offices(){
    //component state for data
    const [info,setInfo]=useState(null);

    //set state based on server response
    useEffect(()=>{
        setInfo(data)
    },[])



    return(
        <section className="">
            <div className="container">
                <div id="hs_cos_wrapper_how-customers-using-header" className="hs_cos_wrapper hs_cos_wrapper_widget hs_cos_wrapper_type_module"  data-hs-cos-general-type="widget" data-hs-cos-type="module">
                <header className="px-lg-4 text-center">
                    <h2 className=" sw-title u-space-2-top text-center mb-lg-9">
                        Our Offices
                    </h2>
                </header>
            </div>
            </div>
        </section>
    )
}
